<td bgcolor=#FFFFFF>サークルベンチレーション搭載居住性抜群のタフワイドドームテント<br>
<br>
■サークルベンチレーションシステム<br>
■広い居住空間<br>
■アルミ素材のメインポール<br>
■より簡単な取り付けが可能になった新型ポールフック<br>
■ジッパー位置に迷わない2ラインジッパーのDドア<br>
<br>
●耐水圧：約2,000mm(フロア：約2,000mm)<br>
●定員：4～6人用<br>
●使用時サイズ：約300×300×185(h)cm<br>
●収納時サイズ：約φ25×75cm<br>
●重量：約10.6kg<br>
●材質：フライ／75Dポリエステルタフタ(UVPRO、PU防水、シームシール)インナー／68Dポリエステルタフタ（撥水加工）フロア／210Dポリエステルオックス(PU防水、シームシール)ポール／(メイン)アルミ合金約φ14.5mm(フロント)FRP約φ13mm（リアバイザー）FRP約8.7mm(リッジ)FRP約φ7mm<br>
●仕様：前室、キャノピー、メッシュドア×2、ベンチレーション、コード引き込み口、ストームガード、ランタンハンガー、メッシュポケット、<br>
●付属品：ペグ、ロープ、ハンマー、キャリーバッグ<br>
※キャノピーポールは別売りです（180cmが最適です） </td></tr>
